import React, { useEffect, useState } from "react";
import "./Dashboard.css";

const Dashboard = () => {
  const [user, setUser] = useState({ name: "User", id: "" });
  const [notes, setNotes] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [newNote, setNewNote] = useState({ title: "", content: "" });

  useEffect(() => {
    const storedUser = localStorage.getItem("user");
    if (storedUser) {
      const parsedUser = JSON.parse(storedUser);
      setUser(parsedUser);

      fetchNotes(parsedUser.id);
    }
  }, []);

  const fetchNotes = async (userId) => {
    try {
      const res = await fetch(`http://localhost:5000/api/notes?userId=${userId}`);
      const data = await res.json();
      setNotes(data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("user");
    window.location.href = "/login";
  };

  const handleAddNote = async () => {
    if (!newNote.title || !newNote.content) return alert("Fill all fields");

    try {
      const res = await fetch("http://localhost:5000/api/notes", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ ...newNote, user: user.id }),
      });

      const data = await res.json();
      setNotes([...notes, data]); // add new note to state
      setShowModal(false); // close modal
      setNewNote({ title: "", content: "" }); // reset form
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div className="dashboard-wrapper">
      {/* Sidebar */}
      <aside className="sidebar">
        <h2>Noteflow</h2>
        <ul>
          <li>All Notes</li>
          <li>Favorites</li>
          <li>Shared</li>
        </ul>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <header>
          <h1>Welcome, {user.name}!</h1>
          <button className="logout-btn" onClick={handleLogout}>Logout</button>
        </header>

        <section className="notes-section">
          {notes.length === 0 ? (
            <p>No notes yet</p>
          ) : (
            notes.map((note) => (
              <div key={note._id} className="note-card">
                <h3>{note.title}</h3>
                <p>{note.content}</p>
              </div>
            ))
          )}
        </section>

        {/* Add Note Button */}
        <button className="add-note-btn" onClick={() => setShowModal(true)}>+ Add Note</button>

        {/* Modal */}
        {showModal && (
          <div className="modal">
            <div className="modal-content">
              <h2>Add New Note</h2>
              <input
                type="text"
                placeholder="Title"
                value={newNote.title}
                onChange={(e) => setNewNote({ ...newNote, title: e.target.value })}
              />
              <textarea
                placeholder="Content"
                value={newNote.content}
                onChange={(e) => setNewNote({ ...newNote, content: e.target.value })}
              />
              <button onClick={handleAddNote}>Save</button>
              <button onClick={() => setShowModal(false)}>Cancel</button>
            </div>
          </div>
        )}
      </main>
    </div>
  );
};

export default Dashboard;
